import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';
import HomePage from './pages/homepage/homepage.component';

function App() {
  return (
    <Route>
      <Routes exact path='/' comeponent={HomePage}></Routes>
    </Route>
  );
}

export default App;
